import './App.css';
import Header from "./Component/Header/Header";
import Create_Note from "./Component/Create_Note/Create_Note";
import Note from "./Component/Note/Note";
import Footer from "./Component/Footer/Footer";

function App() {
  return (
    <div className="App">
         <Header />
         <Create_Note />
         <Note />
         <Footer />
    </div>
  );
}

export default App;
